import Pagination from "../Pagination/Pagination";
import Card from "../Card/Card";

const Home = (allVideogames) =>{

    return(
        <div>
            {
                allVideogames.map(({id, name, image, genres})=>{
                    return(
                        <Card 
                            key={id}
                            id={id}
                            image={image}
                            name={name}
                            genres={genres}
                        />
                    )
                })
            }
        </div>
    )

}


export default Home;
